In C programming, there are several ways to terminate a program. Here are a few methods:

1. **Using the `exit()` function**: The `exit()` function is a standard library function in C that terminates the program immediately. It takes an integer as an argument, which is the exit status of the program. A status of 0 indicates successful execution, while a non-zero status indicates an error.

   ```c
   #include <stdlib.h>

   int main() {
       // Your code here
       exit(0); // or exit(1) for an error
   }
   ```

2. **Using the `return` statement**: The `return` statement can be used to exit a function and return control to the caller. If the `main()` function is the entry point of the program, the `return` statement will terminate the program.

   ```c
   #include <stdio.h>

   int main() {
       // Your code here
       return 0; // or return 1 for an error
   }
   ```

3. **Using `exit()` with a signal**: You can also use the `exit()` function with a signal to terminate the program. This is useful when you want to handle signals in your program.

   ```c
   #include <stdlib.h>
   #include <signal.h>

   void signal_handler(int sig) {
       exit(0);
   }

   int main() {
       signal(SIGINT, signal_handler); // handle SIGINT signal
       // Your code here
       return 0;
   }
   ```

4. **Using `abort()`:** The `abort()` function is another way to terminate a program. It is similar to `exit()`, but it does not return any value to the operating system.

   ```c
   #include <stdlib.h>

   int main() {
       // Your code here
       abort();
   }
   ```

5. **Using `atexit()`:** The `atexit()` function is used to register a function to be called when the program terminates. This can be used to perform cleanup tasks before the program exits.

   ```c
   #include <stdlib.h>

   void cleanup() {
       // Your cleanup code here
   }

   int main() {
       atexit(cleanup);
       // Your code here
       return 0;
   }
   ```

Remember to use these functions responsibly and according to the context of your program.
